int printField(char field[HEIGHT][WIDTH]) {
	int j,i;
	char c;

	for(j=0;j<HEIGHT;j++) {
		for(i=0;i<WIDTH;i++) {
			c='.';
			if(field[j][i]==1) c='>';
			else if (field[j][i]==2) c='v';
			printf("%c",c);
		}
		printf("\n");
	}
	printf("\n");
}

int main() {
	int i,j,m,n;
	int moved;
	int round=0;
	char source[HEIGHT][WIDTH];
	char target[HEIGHT][WIDTH];

	memcpy(target,INITstate,HEIGHT*WIDTH*sizeof(char));

	printField(target);
	while(++round) {

		memcpy(source,target,HEIGHT*WIDTH*sizeof(char));
		memset(target,0,HEIGHT*WIDTH*sizeof(char));

		moved=0;
		for(j=0;j<HEIGHT;j++)
			for(i=0;i<WIDTH;i++) {
				if(source[j][i]==1) { // Moving right
					m=(i+1==WIDTH)?0:i+1; n=j;
					if(!source[n][m]) {
						target[n][m]=source[j][i];
						moved++;
					}
					else
						target[j][i]=source[j][i];
				}
			}
		for(i=0;i<WIDTH;i++)
			for(j=0;j<HEIGHT;j++) {
				if(source[j][i]==2) { // Moving down
					m=i; n=(j+1==HEIGHT)?0:j+1;
					if((!target[n][m])&&(source[n][m]!=2)) {
						target[n][m]=source[j][i];
						moved++;
					}
					else
						target[j][i]=source[j][i];
				}
			}

//		printField(target);
		if(!moved) break;
	}

	printf("Total rounds: %d\n", round);

	return 0;
}
